import React from "react";
import { Formik, Form, Field } from "formik";
import { TextField } from "@mui/material";

const SabhasadregistrationForm = () => {
  const handleSubmit = (values) => {
    // Handle form submission here

    console.log(values);
  };

  return (
    <Formik
      initialValues={{
        MemberNo: "",
        name: "",
        TypeofMember: "",
        Typeoffarmer: "",
        NameofFatherHusband: "",
        Surname: "",
        NameInEnglish: "",
        NameofFatherHusbandInEnglish: "",
        SurnameInEnglish: "",
        Mainly: "",
        birthdate: "",
        Age: "",
        ResolutionNo: "",
        DateofResolution: "",
        status: "",
        SelectFarmerStatus: "",
        Address1: "",
        Address2: "",
        village: "",
        pin: "",
        Taluk: "",
        State: "",
        country: "",
        phoneNo: "",
        Mobileno: "",
        Gender: "",
        caste: "",
        SubCaste: "",
        casteclass: "",
        study: "",
        profession: "",
        MaritalStatus: "",
        RationCardNo: "",
        ElectionCardNo: "",
        AadhaarCardNo: "",
        PANCardNo: "",
        email: "",
        SavingsAccountNo: "",
        KCCCardNo: "",
        CardIssueDate: "",
      }}
      onSubmit={handleSubmit}
    >
      <Form>
        <Field name="memberNo" as={TextField} label="Member No" />
        <Field name="typeOfMember" as={TextField} label="Type of Member" />
        {/* ... other fields */}
        <button type="submit">Submit</button>
      </Form>
    </Formik>
  );
};

export default SabhasadregistrationForm;
